script: |
  super -f tsv -I q9232.sql | sort > q9232.out

vector: true

inputs:
  - name: q9232.sql
    data: |
      SELECT + col2 + - CAST ( NULL AS INTEGER ) / 11 + + col1 AS col0 FROM tab1 AS cor0 GROUP BY col1, col2, col1 HAVING + - ( - - 62 ) NOT BETWEEN + 56 * 2 AND NULL;
  - name: tab1

outputs:
  - name: q9232.out
    data: |
      NULL
      NULL
      NULL
